tables.table_schema:
CREATE TABLE demographics (
    id SERIAL PRIMARY KEY,
    community_id INT,
    population INT,
    median_income DECIMAL(10,2)
);

CREATE TABLE communities (
    community_id INT PRIMARY KEY,
    name VARCHAR(50) NOT NULL,
    region VARCHAR(50),
    state VARCHAR(2)
);

CREATE TABLE initiatives (
    initiative_id SERIAL PRIMARY KEY,
    community_id INT,
    start_date DATE,
    end_date DATE
);

CREATE TABLE target_communities (
 id INT PRIMARY KEY,
 community_id INT,
 target_population INT,
 assistance_program VARCHAR(255)
);

CREATE TABLE community_coordinates (
 id INT PRIMARY KEY,
 community_id INT,
 latitude DECIMAL(10,6),
 longitude DECIMAL(10,6)
);

CREATE TABLE community_resources (
 id INT PRIMARY KEY,
 resource_id INT,
 resource_name VARCHAR(255),
 availability BOOLEAN
);
